import React from 'react';
import './About.css'; // Import the CSS file for the About page styles

const About = () => {
  return (
    <div className="about-page">
      <div className="about-page__content">
        <h2>About Us</h2>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed dictum, elit vitae condimentum faucibus, metus
          lorem scelerisque sapien, id tincidunt nisi odio non nisi. Integer fermentum nec nisi et feugiat.
        </p>
        <p>
          Nulla a dignissim quam. Vivamus efficitur auctor tortor nec gravida. Duis ac feugiat nulla, ac suscipit nunc.
          Integer feugiat rhoncus purus quis sagittis. Duis porttitor magna vel elit consequat dictum. Sed at hendrerit
          odio. Duis laoreet ipsum ut varius auctor. Aenean commodo mauris at augue scelerisque facilisis. Nullam nec
          neque pharetra, tristique ligula eu, fermentum risus. Fusce sollicitudin, arcu ac congue tincidunt, sem sem
          convallis mi, id convallis nisi dui a arcu. Duis consectetur iaculis massa, vel euismod enim tristique quis.
        </p>
      </div>
    </div>
  );
};

export default About;
